import Link from 'next/Link';

const Nav = () => {
  return(
    <div className="navbar">
      <Link href="/">
        <span className="link">Home</span>
      </Link>
      <Link href="/about">
        <span className="link">About</span>
      </Link>

      <style jsx>{`
        .navbar {
          background-color: indigo;
          color: white;
        }
        .link {
          font-size: 2rem;
          padding: 0 1rem;
        }
      `}</style>
    </div>
  )
}

export default Nav;
